import React from 'react';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormControl from '@material-ui/core/FormControl';
import FormLabel from '@material-ui/core/FormLabel';

const RadioButtonsGroup = ()  => {
  const [value, setValue] = React.useState('female');

  const handleChange = (event) => {
    setValue(event.target.value);
  };

  return (
    <FormControl component="fieldset">
      <RadioGroup aria-label="gender" name="gender1" value={value} onChange={handleChange}>
        <FormControlLabel value="female" control={<Radio />} label="Saya Seorang Talent" />
        <FormControlLabel value="male" control={<Radio />} label="Saya Seorang Pencari Talent" />
      </RadioGroup>
    </FormControl>
  );
}

RadioButtonsGroup.defaultProps = {}

RadioButtonsGroup.propTypes = {}

export default React.memo(RadioButtonsGroup)
